    fun createMockHttpClient(): HttpClient {
        val mockEngine = MockEngine { request ->
            val path = request.url.fullPath
            val json = when {
                path.contains("event") -> MOCK_EVENT_JSON
                path.contains("player") -> MOCK_PLAYER_JSON
                path.contains("club") -> MOCK_CLUB_JSON
                else -> "{}"
            }

            respond(
                content = json,
                status = HttpStatusCode.OK,
                headers = headersOf("Content-Type", "application/json")
            )
        }

        return HttpClient(mockEngine) {
            install(ContentNegotiation) {
                json(
                    Json {
                        ignoreUnknownKeys = true
                        isLenient = true
                    }
                )
            }
        }
    }


    override suspend fun getEvent(): Response<Event> {
        val result: Event = client.get("https://mock.api/event").body()
        return Response.Success(result)
    }

    override suspend fun getProfile(tag: String): Response<Player> {
        val result: Player = client.get("https://mock.api/player?tag=$tag").body()
        return Response.Success(result)
    }

    override suspend fun getClub(tag: String): Response<Club> {
        val result: Club = client.get("https://mock.api/club/$tag").body()
        return Response.Success(result)
    }
